import { useParams } from 'react-router-dom';

function Recipe() {
  let { recipeID } = useParams();

  try {
    var recipe = require(`../../../data/recipes/${recipeID}.json`);
  } catch (e) {
    return <>Recipe: Not found</>;
  }

  return <>Recipe: {recipe.name}</>;
}

export default Recipe;
